import { NavBar } from "../../components/sections/navBar";
import { Footer } from "../../components/sections/footer.js";

import { Container, Button, Stack } from "react-bootstrap";

import React, { Component } from "react";
import { Link } from "react-router-dom";

export class MyAccount extends Component {
  render() {
    return (
      <>
        <NavBar />
        <Container>
        <Stack gap={2} className="col-md-5 mx-auto">
      <Button variant="flat" className="buttonLA">Save changes</Button>
      <Button variant="flat" className="buttonLA">Cancel</Button>
    </Stack>


          <div className="myAccountContent">
            <div className="btn-toolbar">
              <Link className="myAccountLink">My Preferences</Link>
              <Link className="myAccountLink" to="/user/myRequests">
                My Requests**
              </Link>
            </div>
            <div className="btn-toolbar">
              <Link className="myAccountLink">My Events </Link>
              <Link className="myAccountLink" to="/user/myRequests">
                My Services
              </Link>
            </div>
          </div>
        </Container>
        <Footer />
      </>
    );
  }
}
